def is_multiply_prime(a):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def prime_factors(n):
        factors = []
        # Divide by 2 to get rid of all even factors
        while n % 2 == 0:
            factors.append(2)
            n //= 2
        # Now n is odd, start from 3 and check for prime factors
        for i in range(3, int(n**0.5) + 1, 2):
            while n % i == 0:
                factors.append(i)
                n //= i
        # If n is a prime number greater than 2
        if n > 2:
            factors.append(n)
        return factors

    factors = prime_factors(a)
    return len(factors) == 3 and all(is_prime(f) for f in factors)

