    Encode the message by swapping case and replacing vowels with the letter 2 places ahead.
    """
    vowels = 'aeiouAEIOU'
    vowel_replacement = {'a': 'c', 'e': 'g', 'i': 'k', 'o': 'q', 'u': 'w',
                         'A': 'C', 'E': 'G', 'I': 'K', 'O': 'Q', 'U': 'W'}
    encoded_message = ''
    for char in message:
        if char in vowels:
            encoded_message += vowel_replacement[char]
        else:
            encoded_message += char.swapcase()
    return encoded_message

