        if (x, y, steps) in visited:
            continue
        visited.add((x, y, steps))
        if steps == k - 1:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                new_cost = grid[nx][ny]
                new_path = path + [new_cost]
                heappush(min_heap, (new_cost, steps + 1, nx, ny, new_path))

