from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = []
    for i in range(N):
        for j in range(N):
            heappush(pq, (grid[i][j], 1, [(grid[i][j])], i, j))
    visited = set()

    while pq:
        val, length, path, x, y = heappop(pq)
        if (x, y, length) in visited:
            continue
        visited.add((x, y, length))
        if length == k:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                newPath = path + [grid[nx][ny]]
                heappush(pq, (newPath[0], length + 1, newPath, nx, ny))

