    # Count open and close parentheses in both strings
    open_first, close_first = first.count('('), first.count(')')
    open_second, close_second = second.count('('), second.count(')')

    # If both strings have more open parentheses than close or vice versa, it's impossible to match
    if (open_first < close_first and open_second < close_second) or (open_first > close_first and open_second > close_second):
        return 'No'

    # If the first string has more close parentheses, it must go second
    if close_first > open_first:
        return 'Yes' if open_second >= close_first - open_first else 'No'
