from heapq import heappush, heappop

def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = []
    for i in range(N):
        for j in range(N):
            heappush(pq, (grid[i][j], [(i, j)], grid[i][j]))

    while pq:
        _, path, val = heappop(pq)
        if len(path) == k:
            return [grid[x][y] for x, y in path]
        for dx, dy in moves:
            x, y = path[-1]
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N and (nx, ny) not in path:
                newPath = path + [(nx, ny)]
                newVal = val * (N*N) + grid[nx][ny]
                heappush(pq, (newVal, newPath, newVal))

