def starts_one_ends(n):
    """
    Given a positive integer n, return the count of the numbers of n-digit
    positive integers that start or end with 1.
    """
    if n == 1:
        return 1  # Only one number of 1-digit which is 1 itself
    else:
        # For n > 1, the first or last digit can be 1, but not both to avoid double counting
        # 1. First digit is 1: 1xxxx... (10^(n-1) possibilities)
        # 2. Last digit is 1: xxxx...1 (10^(n-1) possibilities)
        # Subtract the case where both are 1, which is counted in both of the above cases
        return 2 * (10 ** (n - 1)) - (10 ** (n - 2))

