def minPath(grid, k):
    N = len(grid)
    moves = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], k-1, i, j, [grid[i][j]]) for i in range(N) for j in range(N)]
    while pq:
        cost, steps, x, y, path = heappop(pq)
        if steps == 0:
            return path
        for dx, dy in moves:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                heappush(pq, (cost, steps-1, nx, ny, path + [grid[nx][ny]]))

