def prime_fib(n: int) -> int:
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def fib():
        a, b = 0, 1
        while True:
            yield b
            a, b = b, a + b

    count, fib_gen = 0, fib()
    while True:
        current_fib = next(fib_gen)
        if is_prime(current_fib):
            count += 1
            if count == n:
                return current_fib

def triples_sum_to_zero(l: list):
    l.sort()
    n = len(l)
    for i in range(n-2):
        a = l[i]
        start = i + 1
        end = n - 1
        while start < end:
            b = l[start]
            c = l[end]
            if a + b + c == 0:
                return True
            elif a + b + c > 0:
                end -= 1
            else:
                start += 1
    return False

def pairs_sum_to_zero(l):
