def largest_prime_factor(n: int) -> int:
    def is_prime(num):
        if num <= 1:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    prime_factor = 1
    i = 2

    while i <= n // i:
        if n % i == 0:
            if is_prime(i):
                prime_factor = i
            n //= i
        else:
            i += 1

    if n > prime_factor:
        prime_factor = n

    return prime_factor

