def is_multiply_prime(a):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    for i in range(2, a):
        if is_prime(i):
            for j in range(i, a):  # start from i to avoid repetition
                if is_prime(j):
                    for k in range(j, a):  # start from j to avoid repetition
                        if is_prime(k) and i * j * k == a:
                            return True
    return False

