def intersection(interval1, interval2):
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    start_max = max(interval1[0], interval2[0])
    end_min = min(interval1[1], interval2[1])
    if start_max > end_min:
        return "NO"
    length = end_min - start_max + 1
    return "YES" if is_prime(length) else "NO"

def prod_signs(arr):
    if not arr:
        return None
    sign_product = 1
    magnitude_sum = 0
    for num in arr:
        sign_product *= (1 if num > 0 else -1 if num < 0 else 0)
        magnitude_sum += abs(num)
    return magnitude_sum * sign_product

from heapq import heappop, heappush

def minPath(grid, k):
    N = len(grid)
    directions = [(0, 1), (1, 0), (-1, 0), (0, -1)]
    pq = [(grid[i][j], i, j, k-1, [grid[i][j]]) for i in range(N) for j in range(N)]
    pq.sort()

    while pq:
        _, x, y, steps, path = heappop(pq)
        if steps == 0:
            return path
        for dx, dy in directions:
            nx, ny = x + dx, y + dy
            if 0 <= nx < N and 0 <= ny < N:
                heappush(pq, (path + [grid[nx][ny]], nx, ny, steps - 1, path + [grid[nx][ny]]))

def tri(n):
    if n == 0:
        return [1]
    if n == 1:
        return [1, 3]
    trib = [1, 3]
    for i in range(2, n + 1):
        if i % 2 == 0:
            trib.append(1 + i / 2)
        else:
            trib.append(trib[i - 1] + trib[i - 2] + trib[i - 1])
    return trib

def digits(n):
    product = 1
    has_odd = False
    for digit in str(n):
        if int(digit) % 2 != 0:
            has_odd = True
            product *= int(digit)
    return product if has_odd else 0

def is_nested(string):
    stack = []
    for char in string:
        if char == '[':
            stack.append(char)
        elif char == ']' and stack:
            stack.pop()
            if not stack or stack[-1] == ']':
                return True
    return False

